def gen_random_password_hash():
    random_string = ''.join(random.choices(string.ascii_uppercase + string.digits, k=10))
    sha256_hash = hashlib.sha256(random_string.encode()).hexdigest()
    return sha256_hash

def gen_hire_dates():

    start_date = datetime(2020, 1, 1)
    end_date = datetime(2022, 1, 1)

    return [(start_date + timedelta(days=random.randint(0, (end_date - start_date).days))).strftime('%Y-%m-%d') for _ in range(100)]

def gen_random_date():
    days_to_add = random.randint(-500, 0)
    hours_to_add = random.randint(-500, 0)
    today = datetime.today()
    new_date = today + timedelta(days=days_to_add, hours=hours_to_add)

    return new_date

